import React from 'react';
import { Box, Typography, Button, Grid, Card, CardMedia, CardContent, Divider } from '@mui/material';
import { styled } from '@mui/system';

// Styled Components for Premium Look
const HeroSection = styled(Box)({
  backgroundImage: `url('https://images.unsplash.com/photo-1523381210434-271e8be1f52b?ixlib=rb-4.0.3&auto=format&fit=crop&w=1350&q=80')`, // Dummy hero image
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  height: '90vh',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#ffffff',
  textAlign: 'center',
  padding: '0 40px', // Increased padding for better alignment
  position: 'relative',
  '&:before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.6)', // Darker overlay for better contrast
  },
});

const HeroButton = styled(Button)({
  backgroundColor: '#ffffff',
  color: '#000000',
  padding: '14px 40px',
  fontSize: '1.2rem',
  fontWeight: 'bold',
  borderRadius: '50px',
  textTransform: 'none',
  boxShadow: '0 4px 15px rgba(255, 255, 255, 0.4)',
  transition: 'background-color 0.3s ease, transform 0.2s ease, box-shadow 0.3s ease',
  '&:hover': {
    backgroundColor: '#e0e0e0',
    transform: 'scale(1.05)',
    boxShadow: '0 6px 20px rgba(255, 255, 255, 0.6)',
  },
});

const Section = styled(Box)({
  padding: '100px 60px', // Increased padding for better spacing
  backgroundColor: '#000000',
  color: '#ffffff',
  maxWidth: '1400px', // Constrain content width for better alignment
  margin: '0 auto', // Center the section
});

const ProductCard = styled(Card)({
  backgroundColor: '#1a1a1a',
  color: '#ffffff',
  borderRadius: '12px',
  overflow: 'hidden',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  height: '100%', // Ensure all cards are the same height
  display: 'flex',
  flexDirection: 'column',
  '&:hover': {
    transform: 'translateY(-10px)',
    boxShadow: '0 10px 30px rgba(255, 255, 255, 0.2)', // White shadow on hover
  },
});

const ProductCardContent = styled(CardContent)({
  flexGrow: 1, // Ensures content takes up remaining space
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'space-between',
  textAlign: 'center',
  padding: '20px', // Consistent padding
});

const SectionTitle = styled(Typography)({
  fontWeight: 'bold',
  fontSize: '3rem', // Slightly larger for emphasis
  marginBottom: '60px',
  textAlign: 'center',
  color: '#ffffff',
  position: 'relative',
  '&:after': {
    content: '""',
    position: 'absolute',
    width: '80px', // Wider underline for better visual balance
    height: '4px',
    backgroundColor: '#ffffff',
    bottom: '-20px',
    left: '50%',
    transform: 'translateX(-50%)',
  },
});

// Dummy Data with More Details
const featuredProducts = [
  {
    id: 1,
    name: 'Oversized Classic Tee - Black',
    price: '₹1299',
    description: 'Crafted from 100% premium cotton, this black oversized tee offers a relaxed fit perfect for casual outings. Features a minimalist design with a soft, breathable fabric.',
    material: '100% Cotton',
    fit: 'Oversized',
    care: 'Machine Washable',
    image: 'https://images.unsplash.com/photo-1503342217505-b0a15ec3261c?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
  {
    id: 2,
    name: 'Oversized Graphic Tee - White',
    price: '₹1499',
    description: 'Featuring a bold graphic print, this white tee combines style and comfort for everyday wear. Made with a durable print that lasts wash after wash.',
    material: 'Cotton Blend',
    fit: 'Oversized',
    care: 'Hand Wash Recommended',
    image: 'https://images.unsplash.com/photo-1521572163474-6864f9cf17ab?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
  {
    id: 3,
    name: 'Oversized Hoodie - Grey',
    price: '₹1999',
    description: 'Stay cozy with this grey oversized hoodie, crafted with a soft fleece lining for ultimate warmth. Includes a kangaroo pocket and adjustable drawstrings.',
    material: 'Cotton-Polyester Blend',
    fit: 'Oversized',
    care: 'Machine Washable',
    image: 'https://images.unsplash.com/photo-1571945153237-3b3b3f8e25da?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
  {
    id: 4,
    name: 'Oversized Vintage Tee - Green',
    price: '₹1399',
    description: 'A vintage-inspired green tee with a faded wash, offering a retro vibe with modern comfort. Perfect for a laid-back, stylish look.',
    material: '100% Cotton',
    fit: 'Oversized',
    care: 'Machine Washable',
    image: 'https://images.unsplash.com/photo-1618519764620-7403ab66ab5f?ixlib=rb-4.0.3&auto=format&fit=crop&w=500&q=60',
  },
];

const Home = () => {
  return (
    <Box sx={{ backgroundColor: '#000000', minHeight: '100vh' }}>
      {/* Hero Section */}
      <HeroSection>
        <Typography
          variant="h1"
          sx={{
            fontSize: { xs: '3rem', md: '5rem' },
            zIndex: 1,
            mb: 2,
            fontWeight: 'bold',
            letterSpacing: '2px',
            color: '#ffffff',
          }}
        >
          Premium Oversized Tees
        </Typography>
        <Typography
          variant="h5"
          sx={{
            zIndex: 1,
            mb: 4,
            maxWidth: '800px', // Wider max-width for better alignment
            fontWeight: 300,
            lineHeight: 1.5,
            color: '#ffffff',
          }}
        >
          Discover the ultimate blend of comfort and style with Baa M Boo’s exclusive collection for men and women. Crafted with premium materials for a perfect oversized fit that lasts.
        </Typography>
        <Box sx={{ zIndex: 1 }}>
          <HeroButton href="#shop">Shop Now</HeroButton>
        </Box>
      </HeroSection>

      {/* Featured Products Section */}
      <Section>
        <SectionTitle>Featured Collection</SectionTitle>
        <Grid container spacing={4} justifyContent="center">
          {featuredProducts.map((product) => (
            <Grid item xs={12} sm={6} md={3} key={product.id}>
              <ProductCard>
                <CardMedia
                  component="img"
                  height="350" // Fixed height for consistency
                  image={product.image}
                  alt={product.name}
                  sx={{ objectFit: 'cover' }} // Ensures image fits nicely
                />
                <ProductCardContent>
                  <Box>
                    <Typography variant="h6" sx={{ fontWeight: 500, color: '#ffffff', mb: 1 }}>
                      {product.name}
                    </Typography>
                    <Typography variant="body2" sx={{ color: '#cccccc', mb: 2, lineHeight: 1.6 }}>
                      {product.description}
                    </Typography>
                    <Typography variant="body1" sx={{ color: '#ffffff', fontWeight: 'bold', mb: 1 }}>
                      {product.price}
                    </Typography>
                    <Typography variant="caption" sx={{ color: '#999999', display: 'block', mb: 0.5 }}>
                      Material: {product.material}
                    </Typography>
                    <Typography variant="caption" sx={{ color: '#999999', display: 'block', mb: 0.5 }}>
                      Fit: {product.fit}
                    </Typography>
                    <Typography variant="caption" sx={{ color: '#999999', display: 'block' }}>
                      Care: {product.care}
                    </Typography>
                  </Box>
                  <Button
                    sx={{
                      mt: 3,
                      color: '#ffffff',
                      border: '1px solid #ffffff',
                      borderRadius: '20px',
                      padding: '8px 20px',
                      textTransform: 'none',
                      fontWeight: 'bold',
                      '&:hover': {
                        backgroundColor: '#ffffff',
                        color: '#000000',
                        boxShadow: '0 4px 15px rgba(255, 255, 255, 0.4)',
                      },
                    }}
                  >
                    Add to Cart
                  </Button>
                </ProductCardContent>
              </ProductCard>
            </Grid>
          ))}
        </Grid>
      </Section>

      {/* Divider Before Footer */}
      <Divider sx={{ backgroundColor: '#ffffff', height: '1px', maxWidth: '1400px', margin: '0 auto' }} />
    </Box>
  );
};

export default Home;
